import React from 'react'
import '../Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function headerQsomos(){
    return (
      <div class="container" style={{height:'80px'}} >
        <div class="row ">
          <div class="col-lg-12 col-md-12 col-sm-12">
          <h1 style={{fontWeight:"bold", color:"#FDC921", marginLeft:"-75px", fontSize:"22px", marginTop:'25px'}}> GoNFT
              </h1> 
            <div>
              <div id="Logar">
                <p style={{fontWeight:"bold", marginTop:'15px'}}>Quem somos</p>
              </div>
              <div className="botaoLogin" >
                <a href="/">
                  <button id="botaoLogin" style={{ marginTop:'15px'}}>logar</button>
                </a> 
              </div>
            </div>
          </div>
        </div>
      </div>
        
    );
}

export default headerQsomos;
